import React,{useState, useEffect,Fragment} from 'react';
import {GrDislike} from 'react-icons/gr';
import {MdAdd} from 'react-icons/md';
import './App.css';

const App = () =>{
  const [videos,setVideos] = useState([]);
  useEffect(() =>{
    const getVideos = async () =>{
      const request = await fetch('https://orangevalleycaa.org/api/videos');
      const response = await request.json();
      setVideos(response);
    }
    getVideos();
  },[])
  return(
    <Fragment>
      <ul className = 'movies'>
        {
          videos.map( video => <li>
            <a href = ''>
              <video className = 'video' height = {170} width = {300} controls src = {video.video_url}/>
              <div className = 'title-description'>
                <h2>{video.name}</h2>
                <p>{video.description}</p>
              </div>
              <div className = 'dislike-add'>
                <GrDislike style = {{fontSize:"20px"}}/>
                <MdAdd style = {{fontSize:"20px"}}/>
              </div>
            </a>
            </li>)
        }
      </ul>
    </Fragment>
  )
}

export default App;
